export class AllBookingDetailsPage extends Component {
  render() {
    return (
      <Fragment>
        <Menu />

        <div style={{ marginTop: '70px', position: 'relative' }}>
        <AllBookingDetails />
        </div>



<Footer />
      </Fragment>
    )
  }
}

export default AllBookingDetailsPage
